properties.custom_fragment_shader:
uniform float brightness;
out vec4 outColor;
in vec3 pos;

void main()
{
    float tr = 1000;
    float tr1 = 500;
    float tr2 = 0.5;
    float r = floor(sin((pos.x+pos.y+pos.z)* tr1) * cos((pos.x+pos.y+pos.z)* tr) + tr2 * brightness)*.5;
    float g = r*1.5+0.25;
    float b = r*1+0.5;
    float a = r+0.5;

    outColor = vec4(r, g, b, a);
}

properties.custom_vertex_shader:
uniform mat4 viewProjectionMatrix;

in vec3 position;
out vec3 pos;

void main()
{
    pos = position;
    gl_Position = viewProjectionMatrix * vec4(position, 1.0f);
}

